@okeeru #fucknormalitychristmas #finisterrae #lequile #lecce #salento 25.12.19 
Per non farci mancare niente, ad accompagnare il viaggio fra le atmosfere incandescenti rétro e funk-soul-disco dei Nu Guinea, il 25 dicembre ci sarà Okee Ru! Un uragano di energia positiva sono le prime cose a cui si pensa quando si parla di Denis Leo. 
Precoce collezionista di vinili, inizia sin da giovanissimo a miscelare tra loro i suoni provenienti dalla migliore disco e house americana, dirigendosi poi verso paesaggi sonori più esotici e psichedelici.
